import React from "react";
import { FirstName } from "./App";

const ComF = () => {
  return (
    <div>
      <FirstName.Consumer>
        {(value) => {
          console.log(value);
          return <h1> Is It really working {value} </h1>;
        }}
      </FirstName.Consumer>
    </div>
  );
};

export default ComF;
